import React from 'react';

const WeatherCard = ({ data }) => (
  <div className="bg-white rounded-lg shadow-md p-6 mt-4">
    <h2 className="text-2xl font-bold mb-4">{data.city}</h2>
    <div className="grid grid-cols-2 gap-4">
      <div><span className="text-gray-600">Temp:</span> {data.temperature}Â°C</div>
      <div><span className="text-gray-600">Humidity:</span> {data.humidity}%</div>
      <div><span className="text-gray-600">Wind:</span> {data.wind_speed} m/s</div>
      <div><span className="text-gray-600">Conditions:</span> {data.description}</div>
    </div>
    {data.cached && <div className="mt-4 text-sm text-blue-500">(Cached)</div>}
  </div>
);

export default WeatherCard;
